import './App.css';
import Navbar from './components/Navbar';
import Card from './components/Card';
// import placesData from './assets/placesData';
import axios from 'axios';
import React from 'react';

function GetTripData(){
  const {useState, useEffect} = React
  const [trips, setTrips] = useState([])

  useEffect(() => {
    axios
      .get("https://d6svkzibzlbl3o3cqf3bcg3aqu0ivhop.lambda-url.us-east-1.on.aws/")
      .then(res =>
        setTrips(res.data)
      )
  }, [])

  const data = trips
  return (
    data
  )
}

function App() {
  // const visitedPlaces = placesData.map(visit => 
  //   <Card
  //     key={visit.id}
  //     {...visit}
  //   />  
  // )

  return (
    <div>
      <Navbar/>
      <GetTripData/>
      {/* {visitedPlaces} */}
    </div>
  );
}

export default App;
